        close={closeModal}
        label="잘못된 이메일입니다!"
      />
      {/* <ReactModal isOpen={isOpen} className={"modal-box"} overlayClassName={"dimmed"}>
      </ReactModal>
      <button onClick={()=>setIsopen(true)}>Test</button> */}

    </div>
  );
};

export default Diary;
